import React from "react";

import "./Customer.css";

import {api} from "../../../AxiosConfig";

const customer = [
	{ id: 1, name: "one", phoneNumber: "1238654", gender: "male" },
	{ id: 2, name: "two", phoneNumber: "1234434", gender: "male" },
	{ id: 3, name: "three", phoneNumber: "34854354", gender: "female" },
	{ id: 4, name: "five", phoneNumber: "874365345", gender: "male" },
];

const Customer = () => {
	AxiosConfig.api.fletch("");

	return (
		<div>
			{customer.map((c) => {
				return (
					<div id={c.id} className="customer-holder">
						ID: {c.id}
						<br />
						Name: {c.name}
						<br />
						Phone number: {c.phoneNumber}
						<br />
						Gender : {c.gender}
					</div>
				);
			})}
		</div>
	);
};

export default Customer;
